import React from "react";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";

import Icone from "../Configs/Icone";

import PageInicio from "./PageInicio";
import PageGaleria from "./PageGaleria";
import PageFaleconosco from "./PageFaleconosco";
import PageInformes from "./PageInformes";
import PageLogin from "../Pages/PageLogin";
const Tab = createBottomTabNavigator();
export default () => {
  return (
    <Tab.Navigator
      screenOptions={({ route }) => ({
        tabBarIcon: ({ focused, color, size }) => {
          let icone;

          if (route.name === "TabHomeexterna") {
            icone = focused ? (
              <Icone estilo={{}} color={"#F38DAD"} name="home" />
            ) : (
              <Icone estilo={{}} color={"#5BA3D9"} name="home" />
            );
          } else if (route.name === "TabGaleria") {
            icone = focused ? (
              <Icone estilo={{}} color={"#F38DAD"} name="camera" />
            ) : (
              <Icone estilo={{}} color={"#5BA3D9"} name="camera-retro" />
            );
          } else if (route.name === "TabInformes") {
            icone = focused ? (
              <Icone estilo={{}} color={"#F38DAD"} name="address-card" />
            ) : (
              <Icone estilo={{}} color={"#5BA3D9"} name="address-book" />
            );
          } else if (route.name === "TabFaleconosco") {
            icone = focused ? (
              <Icone estilo={{}} color={"#F38DAD"} name="envelope" />
            ) : (
              <Icone estilo={{}} color={"#5BA3D9"} name="envelope-square" />
            );
          } else if (route.name === "TabLogin") {
            icone = focused ? (
              <Icone estilo={{}} color={"#F38DAD"} name="lock" />
            ) : (
              <Icone estilo={{}} color={"#5BA3D9"} name="lock" />
            );
          }
          // You can return any component that you like here!
          return icone;
        },
        tabBarActiveTintColor: "tomato",
        tabBarInactiveTintColor: "gray",
      })}
    >
      <Tab.Screen
        name="TabHomeexterna"
        component={PageInicio}
        options={() => ({ title: "Home", headerShown: false })}
      />
      <Tab.Screen
        name="TabGaleria"
        component={PageGaleria}
        options={() => ({ title: "Galeria de Fotos", headerShown: false })}
      />
      <Tab.Screen
        name="TabInformes"
        component={PageInformes}
        options={() => ({ title: "Informes", headerShown: false })}
      />
      <Tab.Screen
        name="TabFaleconosco"
        component={PageFaleconosco}
        options={() => ({ title: "Fale conosco", headerShown: false })}
      />
      <Tab.Screen
        name="TabLogin"
        component={PageLogin}
        options={() => ({ title: "Acesso", headerShown: false })}
      />
    </Tab.Navigator>
  );
};
